import { Card, CardContent, CardMedia, Typography } from '@material-ui/core'
import React from 'react'

function Orders({order}) {
    if(order && order.length !== 0){
        return (
            <>
                {
                    order.map(single => {
                        return <Card>
                            {
                                single.products.map( product => {
                                    return <>
                                    <CardMedia component="img" alt={product.product.name} height="50%" image={product.product.image}
                                    title={product.product.name} />
                                    <CardContent>
                                        <Typography gutterBottom variant="subtitle1" component="span">{product.product.name}</Typography>
                                        <Typography variant="body2" color="textSecondary" component="p">
                                            {product.product.price}
                                        </Typography>
                                    </CardContent>
                                    </>
                                })
                            }
                        </Card>
                    })
                }
            </>
        )
    } else {
        return (
            <h4>No orders yet!</h4>
        )
    }
}


export default Orders
